// PortfolioSection.js
import React from 'react';
import ProjectComponent from '../ProjectComponent';

function PortfolioSection() {
  const projects = [
    {
      title: 'Project 1',
      imageSrc: 'path_to_image_1',
      deployedLink: 'https://deployed_link_1.com',
      githubLink: 'https://github.com/github_user/project_1'
    },
    {
      title: 'Project 2',
      imageSrc: 'path_to_image_2',
      deployedLink: 'https://deployed_link_2.com',
      githubLink: 'https://github.com/github_user/project_2'
    },
    // Add more projects as needed
  ];

  return (
    <section id="portfolio">
      <h2>Portfolio</h2>
      <div className="projects">
        {projects.map((project, index) => (
          <ProjectComponent
            key={index}
            title={project.title}
            imageSrc={project.imageSrc}
            deployedLink={project.deployedLink}
            githubLink={project.githubLink}
          />
        ))}
      </div>
    </section>
  );
}

export default PortfolioSection;
